import React from "react";
import "./App.css";
import Home from "./pages/Home";
import { useState } from "react";
import { Route, Routes } from "react-router-dom";

const App = () => {
  return (
    <div className="App">
      <Routes>
        <div>
          <Route path="/home" element={<Home />} />
        </div>
      </Routes>
    </div>
  );
};

export default App;
